import React, { useContext } from "react";
import Logo from '../b36cde191e387823d890215d9d552c27.jpg';
import logoutUser from "../services/logoutUser.js"
import { Context } from "../context/userContext"
import {HeadderWrapper, ButtonNormal, ImageDiv, ButtonPanelDiv} from "../styles/css"
import BussinessInformationCard from "./BussinessInformationCard";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faRightFromBracket, faCircleUser } from '@fortawesome/free-solid-svg-icons';

const Header = () => {

    const {token, csfrToken, userLoggedId, userLoggedName} = useContext(Context)

    const [userLoggedNameValue, setUserLoggedNameValue] = userLoggedName;
    const [tokenValue, setTokenValue] = token
    const [csfrTokenValue, setCsfrTokenValue] = csfrToken

    function handleLogout(e) {
        e.preventDefault()

        logoutUser(tokenValue)
        .then((data) =>{ 
            if(!data.error){
                setTokenValue(null)
                setCsfrTokenValue(null)
                setUserLoggedNameValue(null)
            }
        })

    }

    return (
      <HeadderWrapper>
        <ImageDiv>
          <img src={Logo} alt="Logo" />
        </ImageDiv>
        <BussinessInformationCard />
        <ButtonPanelDiv>
        <FontAwesomeIcon icon={faCircleUser} /><p>{userLoggedNameValue}</p>
          <ButtonNormal
            hidden={!tokenValue}
            onClick={(e) => handleLogout(e)}
            href="/"
          >
           <FontAwesomeIcon icon={faRightFromBracket} /> Log out
          </ButtonNormal>
        </ButtonPanelDiv>
      </HeadderWrapper>
    );
}

export default Header;
